INSERT INTO `chat_messages` VALUES (1,'1) Learn how to fix image upload issues in WordPress. <br> 2) Note: If setting directory permissions to 744 does not seem to solve your problem, then try <br> 3)How to Resize and Make Images Larger without Losing Quality <br> I did the steps above and it didn\'t work and 705 was what it was set at before I tried to fix it.<br>Learn how to fix image upload issues in WordPress. <br> Note: If setting directory permissions to 744 does not seem to solve your problem, then try <br> How to Resize and Make Images Larger without Losing Quality <br> I did the steps above and it didn\'t work and 705 was what it was set at before I tried to fix it.<br>Learn how to fix image upload issues in WordPress. <br> Note: If setting directory permissions to 744 does not seem to solve your problem, then try <br> How to Resize and Make Images Larger without Losing Quality <br> I did the steps above and it didn\'t work and 705 was what it was set at before I tried to fix it.<br>Learn how to fix image upload issues in WordPress. <br> Note: If setting directory permissions to 744 does not seem to solve your problem, then try <br> How to Resize and Make Images Larger without Losing Quality <br> I did the steps above and it didn\'t work and 705 was what it was set at before I tried to fix it.<br>Learn how to fix image upload issues in WordPress. <br> Note: If setting directory permissions to 744 does not seem to solve your problem, then try <br> How to Resize and Make Images Larger without Losing Quality <br> I did the steps above and it didn\'t work and 705 was what it was set at before I tried to fix it.<br>','text','fromUser',1028,'toUser',23,'read','2016-08-24 08:07:39',0),(2,'привет Иван Михайлович !','text','fromUser',1030,'toUser',23,'read','2016-08-24 08:07:39',0),(3,'\"Кроха\"-\'Картоха\'','text','fromUser',1028,'toUser',23,'read','2016-08-24 09:07:39',0),(4,'Котя привет','text','fromUser',23,'toUser',1028,'read','2016-09-20 07:25:10',0),(5,'Христофор Плантен или Плантейн (лат. Christophorus Plantinus, фр. Christophe Plantin, нидерл. Christoffel Plantijn; май 1520, Сен-Авертен — 1 июля 1589, Антверпен) — нидерландский издатель и типограф французского происхождения, гуманист. Получил классическое образование, издавал книги на латинском языке, интернациональном для Европы того времени. Начиная с середины XVI века Плантен являлся ведущим издателем Европы, основателем фирмы Officina Plantiniana, имевшей филиалы во всех землях Германии и Нидерландов, Англии и Шотландии, Франции, итальянских государств, Испании и Португалии. Издательство Плантена выпустило более 40 книг, включаемых в число значимых для истории книгопечатания; известнейшими его изданиями стали Антверпенская Полиглотта (1568—1573) и первый атлас земного шара — Theatrum Orbis Terrarum (1580). В 1570 году получил звание Главного королевского печатника, дававшее ему монополию на издание богослужебных книг в испанских владениях; общий их тираж в 1571—1574 годах составил около 75 000 экземпляров. Династия его наследников занималась книгоизданием до 1865 года. Исследователями ХХ века Плантен рассматривался как яркий представитель фламандского Ренессанса, оказавший существенное влияние на издательское дело и книжное искусство Германии и Франции. Полностью сохранившаяся типография с печатными станками и всем содержимым с 1877 года является музеем Плантена — Моретуса.','text','fromUser',1028,'toUser',23,'read','2016-08-25 08:07:39',0),(12,'!<br>,<br>?<br>/','text','fromUser',23,'toUser',1028,'read','2016-09-23 13:57:09',0),(13,'А<br>Б<br>В<br>Г<br>Д<br>Е<br>Ж<br>З<br>Э<br>Ю<br>Я<br>!<br>.','text','fromUser',23,'toUser',1028,'read','2016-09-23 14:01:40',0),(20,'Котя привет','text','fromUser',23,'toUser',1028,'read','2016-09-23 17:22:17',0),(21,'Как дела ?','text','fromUser',23,'toUser',1028,'read','2016-09-23 18:01:43',0),(22,'1-ое сообщение<br>Яя','text','fromUser',23,'toUser',1028,'read','2016-09-23 18:02:10',0),(23,'.','text','fromUser',23,'toUser',1028,'r