>- 14 октября будут рассматриваться дела двух наших граждан - Алексея Ерунова и Сергея Горбачёва, - рассказал \'Известиям\' консул генконсульства РФ в Марселе Даниил Болтакс. - У каждого из адвокатов своя линия поведения, которая направлена на то, что их подзащитные невиновны и их судили \'по горячим следам\'. Будем надеяться, что нам всё-таки удастся сократить срок тюремного заключения Алексея Ерунова. К сожалению, предыдущий опыт апелляции по делу Николая Морозова говорит о том, что французская Фемида, скорее всего, останется непреклонной.','text','fromUser',23,'toUser',1028,'read','2016-10-13 22:00:53',529707653),(277,'Sport.ru / Футбол. Российские фанаты, арестованные после уличных беспорядков в Марселе во время чемпионата Европы-2016 по футболу, в скором времени выйдут на свободу. Николай Морозов, Алексей Ерунов и Сергей Горбачёв, приговорённые к срокам от одного до двух лет заключения, уже более пяти месяцев находятся во французской тюрьме.<bR><bR>14 октября в суде Экс-ан-Прованса будет рассмотрена апелляция двух болельщиков - Ерунова и Горбачёва. Как рассказали \'Известиям\' в генконсульстве РФ в Марселе, уже в ноябре один из фанатов сможет вернуться на родину, а остальные будут условно-досрочно освобождены в течение полугода.<bR><bR>- 14 октября будут рассматриваться дела двух наших граждан - Алексея Ерунова и Сергея Горбачёва, - рассказал \'Известиям\' консул генконсульства РФ в Марселе Даниил Болтакс. - У каждого из адвокатов своя линия поведения, которая направлена на то, что их подзащитные невиновны и их судили \'по горячим следам\'. Будем надеяться, что нам всё-таки удастся сократить срок тюремного заключения Алексея Ерунова. К сожалению, предыдущий опыт апелляции по делу Николая Морозова говорит о том, что французская Фемида, скорее всего, останется непреклонной.','text','fromUser',23,'toUser',1028,'read','2016-10-13 22:03:05',529707785),(278,'й','text','fromUser',23,'toUser',1028,'read','2016-10-13 22:03:24',529707804),(279,'й','text','fromUser',23,'t