INSERT INTO `company_vacancy` VALUES (2,1,15258,1168,15000,20000,8,'fte','профессия, мастер в ателье по ремонту и пошиву одежды по индивидуальным заказам. Закройщик работает непосредственно с заказчиком швейного изделия, выявляет его потребности, даёт рекомендации по выбору ткани и фасона изделия, оформляет паспорт заказа, снимает мерки (антропометрические параметры) с фигуры клиента, зарисовывает эскиз модели, строит чертёж изделия, изготовляет лекала, производит раскраивание ткани на детали кроя, а также перекраивание деталей одежды при её ремонте. Сшивание деталей в готовое изделие производит портной.','Какая вышивка красивее ?','Крестиком','Бантиком','Строчкой',1,'Сколько у швейной машинки передач ?','1','2','3',2,'Какое у иголки ушко ?','Правое','Левое','Не знаю',3,10,11,12,10,14,15,'2017-09-18','week'),(4,1,15259,623,300000,500000,9,'entrepreneur','a person who organizes and operates a business or businesses, taking on greater than normal financial risks in order to do so.','MTU','IOS: L2','IOX: L2 + L3','L3',1,'Полезная нагрузка при MTU 1500 + dot1q','12 gap + 8 preamble + 18 header + 4 trailer = 42 bytes/packet with 802.1q','1500/(42+1500) = 97.2763 %   with 802.1q tags','.1q',2,'UDLD','Uni','Bidir','unknown',3,20,21,22,2,13,7,'2000-01-01','suspend'),(5,1,15259,876,250000,350000,10,'remote','a person who is trained in or follows as a profession a branch of engineering','Point-2-point, Multipoint','p2p','p2mp','mp2mp',2,'вопрос2','правильный','нет','нет',1,'test','1','2','3(!)',3,30,31,32,9,5,4,'2000-01-01','suspend'),(10,1,15261,623,200000,250000,9,'entrepreneur','Работать &quot;не покладая рук&quot; !<bR>Работать, работать и еще раз работать , как завещал великий','PMP - это','Project Management Professional','Pump machinery plumbing','E-mail protocol',1,'Какие отличия Program manager от Project Manager','Program manager - это менеджер програмистов','Program manager - управляет несколькими проектами в одной области','Program manager - сам занимается програм