  KEY `userID` (`userID`),
  KEY `tempSet` (`tempSet`),
  KEY `setID` (`setID`),
  KEY `srcType` (`srcType`)
) ENGINE=InnoDB AUTO_INCREMENT=1461 DEFAULT CHARSET=cp1251;
