INSERT INTO `feed_message` VALUES (1,'Пустое сообщение','','',0,'friends'),(2,'','','Ночь - отель',0,'public'),(3,'C++ / Отличия new от malloc','http://www.quizful.net/interview/cpp/new-malloc-difference','1. new бросает эксепшен в случае неудачи, malloc возвращает 0.2. new вызывает конструктор класса и выделяет память либо просто вызывает конструктор (в случае placement new), malloc только выделяет память.3. new нужен для работы с объектами, malloc для работы непосредственно с памятью.',0,'public'),(4,'Ватикан','https:/<br>u.wikipedia.org/wiki/%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD','Ватика',0,'public'),(5,'ватикан','','Дипломатические миссии иностранных государств аккредитуются при Святом Престоле, а не при городе-государстве Ватикан. Иностранные посольства и представительства, аккредитованные при Святом Престоле, ввиду малой территории Ватикана, размещены в Риме (включая и посольство Италии, которое, таким образом, находится в её собственной столице[8])атикан является постоянным наблюдателем при ООН с 1964 года[9], сотрудничая с организацией с 1957 года[10]. В июле 2004 года права миссии Святого Престола при ООН были расширены[9]. Кроме того, с августа 2008 года Ватикан начал сотрудничество с Интерполом на постоянной основе[11][12].',0,'public'),(6,'Курс доллара','http://select.by/kurs/','Последние новости и прогнозы о курсах валют<br><br>23 декабря доллар второй день подряд дешевеет, евро и российский рубль третий раз подряд подорожали<br>23 декабря на открытии торгов белорусский рубль удвоил давление на доллар, но уступает евро и российскому рублю<br>Президент РБ утвердил финансовые параметры на 2016 год: курс рубля -гибкий, инфляция',0,'public'),(7,'\'Вечер загадок\'','','В продолжение вечера загадок.<br><br>Расшифруйте зашифрованное алгоритмом RSA сообщение: 17, 16, 12, 11, 1<br><br>Public key: {5, 21}<br>Private key: {17, 21}<br>',0,'public'),(8,'Кемеровский суд дал условный срок юному вымогателю.<br>Подробнее...','http://www.cnews.ru/news/top/2015-12-25_yunyj_haker_poluchil_uslovnyj_srok_za_vymogatelstvo','',0,'public'),(9,'','http://cloud.cnews.ru/articles/2015-12-02_loral_rossiya_budushchee_razvitiya_itrynka_za_servisnymi_uslugami','Западные компании, работающие в России, стараются передавать большинство ИТ-функций на аутсорсинг. О том, возможно ли получить в нашей стране услуги такого уровня, в интервью CNews рассказывают Сергей Виноградов, руководитель ИТ-инфраструктуры L',0,'public'),(10,'Названы причины торможения рынка больших данных','http://bigdata.cnews.ru/news/top/2015-11-20_analitiki_otsenili_tempy_rosta_mirovogo_rynka','Рынок больших данных будет демонстрировать рост в период до 2019 г. Однако его доля в составе более крупной отрасли Business Analytics будет убывать. Аналитики назвали основные причины этой тенденции.<br>Подробнее:',0,'public'),(11,'Cost of living comparison between Moscow, Russia and Boston, Massachusetts, United States','https://www.expatistan.com/cost-of-living/comparison/boston/moscow','',0,'public'),(12,'Комната пуков','http://www.sp-fan.ru/tube/2130532/','',0,'public'),(13,'','','',2,'public'),(14,'','','',3,'public'),(15,'','','',4,'public'),(16,'','','',5,'public'),(17,'','','',6,'public'),(18,'','','',7,'public'),(19,'','','',8,'private'),(20,'','','',9,'public'),(21,'Наша свадьба !','','',10,'friends'),(24,'Анджелина Джоли и Бред Питт плачут))))','','Ванюша, поздравляю! Выбор твой прекрасен! Наташенька очаровательна!!! Все очень красиво! Ярко! Будьте всегда! Будьте счастливы!!',0,'friends'),(25,'Зеленый корридор','','',11,'public'),(26,'8-ое марта','','',12,'private'),(27,'1','2','3',0,'public'),(28,'1','2','3',0,'public'),(29,'1','2','3',0,'public'),(30,'111','111','',0,'public'),(31,'222','111','',0,'public'),(32,'1','','',0,'public'),(33,'1','','',0,'public'),(34,'1','','',0,'public'),(35,'Потерялся - веселись !','123','Getting lost has never been so much fun',0,'public'),(36,'Потерялся - веселись','123','Getting lost has never been so much fun',14,'public'),(37,'','','',0