mail.com','mkorsako@gmail.com','user','Y','N','ru','2016-01-11',0,0,'Михаил','Корсаков','','','','N','','',2,'01/08/2007','public','all','2018-05-18 18:49:18',579998958,'fc00::4407:b367:1b35:d59a','2012-12-12 00:00:00','2012-12-12 00:00:00'),(1031,'mbalyasn@connme.ru','mbalyasn@connme.ru','user','Y','N','ru','2016-01-11',0,0,'Михаил','Балясный','','','','N','','',2,'00/00/0000','public','all','2016-11-15 00:14:04',532502044,'80.251.119.105','2016-01-03 00:00:00','2012-12-12 00:00:00'),(1032,'mgorbach@connme.ru','mgorbach@connme.ru','user','Y','N','ru','2016-01-11',0,0,'Михаил','Горбачев','','','','N','','',2,'00/00/0000','public','all','2012-12-12 00:00:00',0,'','2016-01-03 00:00:00','2012-12-12 00:00:00'),(1033,'lbrezhne@connme.ru','lbrezhne@connme.ru','user','Y','N','ru','2016-01-11',0,0,'Леонид','Брежнев','','','','N','На крупных руководящих постах (Молдавия, Политуправление армии и флота, Казахстан)[править | править вики-текст]\nС лета 1950 года — первый секретарь ЦК Компартии Молдавии. Пробыл на этом посту до октября 1952 года, когда после личной встречи со Сталиным на XIX съезде КПСС он впервые избирается членом ЦК, а на послесъездовском пленуме ЦК избирается секретарём ЦК и кандидатом в члены Президиума ЦК партии. Также был членом постоянных комиссий при Президиуме ЦК — по внешним делам и по вопросам обороны (в последней с 19 ноября 1952).\n\nПосле смерти Сталина в марте 1953 года Брежнев освобождён от обеих должностей и назначен начальником политуправления Военно-морского министерства. В связи с последовавшим в том же месяце объединением Военного и Военно-Морского Министерств для образования Министерства обороны были объединены и их политорганы, и Брежнев остался без работы. В мае 1953 года Брежнев обратился с письмом к Председателю Совета министров СССР Г. М. Маленкову с просьбой направить его на работу в парторганизацию Украины[42]. Приказом министра обороны СССР № 01608 от 21 мая 1953 года Брежнев был возвращен в кадры Советской армии.\n\nПо данным П. А. Судоплатова[43] и генерала К. С. Москаленко[44], среди 10 вооружённых генералов, вызванных в Кремль 26 июня 1953 года для ареста Л. П. Берия, был и Л. И. Брежнев.\n\nС 21 мая 1953 по 27 февраля 1954 года заместитель начальника Главного политического управления Советской Армии и Военно-морского флота. Генерал-лейтенант (04.08.1953).\n\nВ 1954 году по предложению Н. С. Хрущёва переводится в Казахстан, где сначала работает вторым, а с 1955 года первым секретарём ЦК компартии республики. Руководит освоением целинных земель. Участвует в подготовке строительства «Научно-исследовательского испытательного полигона № 5» Министерства обороны СССР (нынешний космодром Байконур) в южном Казахстане.','',2,'00/00/0000','public','all','2012-12-12 00:00:00',0,'','2012-12-12 00:00:00','2012-12-12 00:00:00'),(1034,'vputin@connme.ru','vputin@connme.ru','user','Y','N','ru','2016-01-11',0,0,'Владимир','Путин','','','','N','8 мая 2008 года, на следующий день после инаугурации Дмитрия Медведева, кандидатура Путина была утверждена Думой на пост председателя правительства России, и был подписан указ о его назначении[335]. 12 мая Путин огласил состав своего нового правительства.<br><br>Заместителями Путина в качестве председателя правительства стал ряд руководящих сотрудников из Администрации президента — Игорь Шувалов, Игорь Сечин, Сергей Собянин.<br><br>27 мая 2008 года председатель Высшего государственного совета Союзного государства Беларуси и России Александр Лукашенко назначил Путина председателем Совета министров Союзного государства[336].<br><br>В середине 2008 года Путин объявил о необходимости создания в России международного финансового центра (МФЦ), для чего, по его мнению, нужно провести значительные изменения в ряде сфер для улучшения финансовой системы страны. Год спустя Путин подписал указ, которым утвердил подробный план действий по формированию МФЦ, после этого началась активная реализация данного плана. Проект создания МФЦ наряду с модернизацией экономики стал одной из ключевых государственных задач[337][338][339][340].<br><br>На период председательства Путина в правительстве пришёлся российский финансово-экономический кризис 2008—2010 годов.<br><br>С 2009 года Путин стал выступать за более тесную экономическую интеграцию с Казахстаном и Белоруссией, следствием чего стало создание Таможенного союза Белоруссии, Казахстана и России. В процессе создания Таможенного союза был принят ряд документов по образу и подобию ЕС, которые сняли торговые барьеры, существовавшие между странами. Снятие торговых барьеров стимулирует развитие бизнеса и позволяет восстановить производственные цепочки, разорванные после распада СССР. В августе 2011 года на встрече глав правительств трёх стран Таможенного союза была поставлена более амбициозная задача — к 2013 году преобразовать организацию в «Евразийский экономический союз». Путин оценил это как «первый реальный шаг по восстановлению естественных экономических и торговых связей на постсоветском пространстве»[341].<br><br>В октябре 2011 года главы правительств России, Украины, Белоруссии, Казахстана, Армении, Молдавии, Киргизии и Таджикистана подписали соглашение о создании зоны свободной торговли. В день подписания договора Путин заявил о намерении отменить экспортные и импортные пошлины&nbsp;.[342]<br><br>В ноябре 2010 года Путин занял 4-е место в рейтинге самых влиятельных людей мира, составленном американским журналом Forbes.[343] В ноябре 2011 года в аналогичном рейтинге Forbes Путин занял уже 2-е место. Главным достижением Путина в 2011 году журнал назвал идею создания к 2015 году Евразийского Союза между Россией и рядом республик постсоветского пространства, включая Казахстан, Белоруссию и Украину.[344]<br><br>24 сентября 2011 года Путин на съезде партии «Единая Россия» в Москве с благодарностью согласился баллотироваться в президенты страны на выборах 4 марта 2012 года. Путин выразил надежду, что после его победы на президентских выборах правительство России возглавит действующий президент РФ Дмитрий Медведев[345].<br><br>19 февраля 2013 года инициировал создание единого учебника по истории России для средней школы, хронология которого будет завершена 2000 годом[346][347].<br><br>По состоянию на апрель 2013 года, Путин 11 раз провёл многочасовые «прямые линии», отвечая в телеэфире на вопросы граждан России[348].','',2,'00/00/0000','public','all','2016-01-13 09:02:16',0,'80.251.119.105','2012-12-12 00:00:00','2012-12-12 00:00:00'),(1035,'vpozner@connme.ru','vpozner@connme.ru','user','Y','N','ru','2016-01-11',0,0,'Владимир','Познер','','','','N','В октябре 1961 года Познер поступил на работу в Агентство печати «Новости», работал редактором в распространявшемся за рубежом (в основном, в США) журнале «USSR» («СССР»), позднее переименованном в Soviet Life («Советская жизнь»), а с 1967 — в журнале «Спутник». В 1967 году вступил в КПСС. В 1968 году совместно со своей первой женой В. Н. Чемберджи перевёл и издал в СССР книгу Вуди Гатри «Поезд мчится к славе» (англ. Bound for Glory)[20].\n\nВ 1970 году перешёл на работу в Комитет по телевидению и радиовещанию (впоследствии Гостелерадио СССР) в качестве комментатора главной редакции радиовещания на США и Англию, где одновременно был секретарём парткома и до конца 1985 года ежедневно вёл свою радиопередачу на английском языке. Американские радиослушатели могли слышать его в ток-шоу Рэя Брима (Ray Briem) Лос-Анжелесской радиостанции KABC (AM).\n\nС конца 1970-х годов, как правило, посредством спутниковой связи, Познер появляется на западном телевидении. Он был частым гостем в программе Nightline[en] на канале American Broadcasting Company, а также в шоу Фила Донахью[en]. Представлял в лучшем свете заявления и решения руководства Советского Союза относительно тех или иных внутренних и международных вопросов, и, зачастую, оправдывал наиболее противоречивые из них. Среди таких решений были решения о вводе советских войск в Афганистан[21] и уничтожении южнокорейского Боинга[22].\n\nВ 1991—1997 годах — соведущий на канале CNBC (США) в программе «Познер и Донахью».\n\nВ настоящее время ведёт авторскую программу «Познер» на «Первом канале».','',2,'00/00/0000','public','all','2012-12-12 00:00:00',0,'','2012-12-12 00:00:00','2012-12-12 00:00:00'),(1036,'zemlinka@gmail.com','zemlinka@gmail.com','user','Y','N','ru','2016-05-10',0,0,'Марина','Кучина','','','','N','','female',2,'00/00/0000','public','all','2017-11-06 20:05:29',563331929,'195.230.109.158','2016-05-10 00:00:00','2016-05-10 21:30:51'),(1037,'vkutnenk@connme.ru','ivan.kuchin@connme.ru','user','Y','N','ru','2016-06-27',0,0,'Василий','Кутненко','','','','N','','',2,'00/00/0000','public','all','2016-06-27 20:46:33',0,'80.251.119.105','2016-06-27 18:19:48','2016-06-27 18:18:36');
